_speciesOrGeneNumberSort=function(e,r,n,c){var s="";if("gene"==n)s=/^([0-9]+) gene/;else{if("species"!=n)throw"unrecognized type"+n;s=/^([0-9]+) species/}return(e=null!==(e=e.replace(",",".").match(s))?parseFloat(e[0]):c)<(r=null!==(r=r.replace(",",".").match(s))?parseFloat(r[0]):c)?-1:e>r?1:0},jQuery.extend(jQuery.fn.dataTableExt.oSort,{"scientific-pre":function(e){return parseFloat(e)},"scientific-asc":function(e,r){return e<r?-1:e>r?1:0},"scientific-desc":function(e,r){return e<r?1:e>r?-1:0},"species-number-asc":function(e,r){return _speciesOrGeneNumberSort(e,r,"species",Number.POSITIVE_INFINITY)},"species-number-desc":function(e,r){return-1*_speciesOrGeneNumberSort(e,r,"species",Number.NEGATIVE_INFINITY)},"gene-number-asc":function(e,r){return _speciesOrGeneNumberSort(e,r,"gene",Number.POSITIVE_INFINITY)},"gene-number-desc":function(e,r){return-1*_speciesOrGeneNumberSort(e,r,"gene",Number.NEGATIVE_INFINITY)}});